"Biz qanday ma’lumotlarni to‘playmiz va ishlatamiz?
Biz siz o‘rnatgan ilova nomlari va qaysi o‘yinni o‘ynayotganingiz haqidagi ma’lumotlarni to‘plashimiz mumkin. Biz ushbu ma’lumotlardan quyidagi maqsadlarda foydalanishimiz mumkin:
ushbu Xizmat funksiyalarining ishlashini ta’minlash;
ushbu Xizmatdagi avvalgi xatti-harakatlaringiz asosida mobil o‘yinlar bo‘yicha sizga mos tavsiyalar berish;
bozor, mijozlar, mahsulot va xizmatlarimizni baholash va tahlil qilish uchun;
odamlar ushbu Xizmatdan qanday usulda foydalanishini tushunish hamda shu yo‘l bilan uni takomillashtirish va yangi mahsulot va xizmatlarni ishlab chiqish."
